// https://leetcode.com/problems/sort-an-array => TLE with duplicate values
#include <bits/stdc++.h>
using namespace std;

class Solution {
    int partition(vector<int> &nums, int st, int en){
        int mid = st + (en - st) / 2;

        // find right location
        int pvt_idx = st;
        for(int i = st; i <= en; ++i)
            pvt_idx += (nums[mid] >= nums[i] && mid != i);
        // put it there
        swap(nums[pvt_idx], nums[mid]);

        // swap smaller values
        while(st < en){
            while(nums[pvt_idx] >= nums[st] && st < pvt_idx)
                ++st;
            while(nums[pvt_idx] < nums[en])
                --en;

            swap(nums[st],nums[en]);
        }
        return pvt_idx;
    }

    void quickSort(vector<int> &nums, int st, int en){
        if(st >= en) return;

        int pivot = partition(nums, st, en);
        quickSort(nums, st, pivot-1);
        quickSort(nums, pivot+1, en);
    }

public:
    vector<int> sortArray(vector<int>& nums) {
        quickSort(nums, 0, nums.size() - 1);
        return nums;
    }
};

void test(vector<int>& vec1){
    vector<int> vec2 = vec1;

    Solution().sortArray(vec1);
    sort(vec2.begin(), vec2.end());

    assert(vec1 == vec2);
}

